import React from 'react'


const Table = (props)=>{
    console.log('Hey')
    console.log(props)
    props.props.TData.map((heading, index) => {
        console.log(heading[0])
    })
    
    return(
        <div>
            <p>GGGGG</p>
            <div className="z-depth-4">
                <table className="responsive-table centered bordered">
                    <thead>
                        <tr>
                            {
                              props.props.THead.map((heading , index) => {
                                return(
                                    <th>{heading}</th>
                                )
                            })  
                            }
                        </tr>
                    </thead>
                </table>
            </div>
        <div/>
        </div>
    )
}

export default Table
